import { BrowserRouter, Routes, Route } from "react-router-dom";
import Login from "./components/login/Login";
import Signup from "./components/login/Signup";
import Home from "./components/homepage/Home";
import Main from "./components/content/Main";
// import Dashboard from "./components/dashboard/Dashboard";
// import Dashboard from "./components/dashboard/Dashboard";
import Error404 from "./components/pages/samples/Error404";
import Error505 from "./components/pages/samples/Error500";
// import BlankPage from "./components/pages/samples/BlankPage";


function App(props) {
  let head = props.head;
  let sethead = props.sethead;
  return (
    <>
      <BrowserRouter>
        <Routes>
          <Route path="/main" element={<Main />} />

          <Route path="/" element={<Home />} />
          <Route path="/login" element={<Login />} />
          <Route path="/signup" element={<Signup />} />
          <Route path="/Error404" element={<Error404 />} />
          <Route path="/Error505" element={<Error505 />} />

         {/* <Route path="/BlankPage" element={<BlankPage/>}/> */}
        </Routes>
      </BrowserRouter>
    </>
  );
}

export default App;
